import { Container } from "@mui/material";
import React from "react";
import { useParams } from "react-router-dom";

const ChatRoom = () => {
  const { roomId } = useParams();
  return (
    <Container>
      <h2>roomId : {roomId}</h2>
      <h2>채팅 내용</h2>
    </Container>
  );
};

export default ChatRoom;
